import SHOP_DATA from '../../../src/shop.data'
import PreviewCollection from '../../components/previewCollection/PreviewCollection'

class ShopPage extends Component {
  state = {
    collections: SHOP_DATA
  }

  render() {
    return (
      <div>
        <PreviewCollection />
      </div>
    )
  }
}
export default ShopPage
